arr.set("dog", "гав-гав"); // заменить значение по ключу

arr.size; // 3
arr.get("fox"); // undefined
arr.has("bird"); // false
arr.delete("dog");

for (let [key, value] of arr) {
    console.log(key + " goes " + value);
}
// "cat goes meow"



let dict = new Map()

let studentsArr = studentsStr.split('; ')
console.log(studentsArr);



studentsArr.map((elem) => {
    dict.set(elem.split(' - ')[1], elem.split(' - ')[0])

})
console.log(dict);




